import React, { useState } from "react";
import "./index.css";
import productList from "./pages/productList";


const [product, setproduct] = useState([
    {
        name : "TRQ white Shoes",
        catogary : "shoes",
        seller : "AMZ Seller Ghz",
        price : 1500
    },
    {
        name : "LOREM Watch Black",
        catogary : "Watches",
        seller : "Watch Ltd Siyana",
        price : 2500
    },
    {
        name : "Amz Laptop 8 gb ram",
        catogary : "Laptop",
        seller : "Delhi Laptop",
        price : 2000
    },
    {
        name : "Cemra",
        catogary : "CCTV",
        seller : "AMZ CCTV Ghz",
        price : 5000
    },
    {
        name : "Gren Voilet",
        catogary : "Viloet",
        seller : "AMZ Gren Voilet",
        price : 3500
    },
    {
        name : "Bottal",
        catogary : "Botal",
        seller : "AMZ Botal",
        price : 1500
    }
])


function App()
{
    return( 
       <>
           <product Product = {product} />
       </>
    )
}
export default App;
